821207a7-094e-408a-a497-1ed9810a331d=\r\nYou need an account for most activities on our platform, including to purchase and enroll in a course or to submit a course for publication. When setting up and maintaining your account, you must provide and continue to provide accurate and complete information, including a valid email address. You have complete responsibility for your account and everything that happens on your account, including for any harm or damage (to us or anyone else) caused by someone using your account without your permission. This means you need to be careful with your password. You may not transfer your account to someone else or use someone else\u2019s account. If you contact us to request access to an account, we will not grant you such access unless you can provide us with the information that we need to prove you are the owner of that account. In the event of the death of a user, the account of that user will be closed.\r\n\r\nYou may not share your account login credentials with anyone else. You are responsible for what happens with your account and we will not intervene in disputes between students or instructors who have shared account login credentials. You must notify us immediately upon learning that someone else may be using your account without your permission (or if you suspect any other breach of security) by contacting our Support Team. We may request some information from you to confirm that you are indeed the owner of your account.\r\n\r\nStudents and instructors must be at least 18 years of age to create an account on Learn It and use the Services. If you are younger than 18 but above the required age for consent to use online services where you live, you may not set up an account, but we encourage you to invite a parent or guardian to open an account and help you enroll in courses that are appropriate for you. If you are below this age of consent to use online services, you may not create a this app account. If we discover that you have created an account that violates these rules, we will terminate your account. Under our Instructor Terms, you may be requested to verify your identity before you are authorized to submit a course for publication on this application.\r\n\r\nYou can terminate your account at any time by following the steps here. Check our Privacy Policy to see what happens when you terminate your account.\r\n\r\n
