be287e82-2ee1-47ae-93a2-ce2bbfa9de52=Description\r\nHelper module that allows developers to quickly implement the session timeout functionality.\r\n\r\nTypical usage scenario\r\nWhen you want to display session timeout warning message if the user is Idle for configured number of time and on no user action automatically terminate user session by logging out user. \r\n\r\nDependencies\r\n\u2022 Mendix 6.10.5 and above\r\n\u2022 Idle Timer widget\r\n\u2022 Microflow Timer widget\r\n\r\nInstallation / Configuration \r\n  - Import the module into your project\r\n\r\n  - Add the 'SNIP_SessionTimeout' snippet into your layout (USE_ME >> SNIP_SessionTimeout)\r\n\r\n  - Update project security \u2013 go to project security >> user roles >> edit each role to select  \u2018AqSessionTimeout\u2019 module role appropriately. \r\n\r\n  - Use the 'SessionTimeoutWarningPopup' to change Idle timer value. (if required)\r\nNOTE\: By default timeout value is set to 9 minutes. If you want to update Idle timer value then go to 'SNIP_SessionTimeout ' snippet  >> edit Idle timer widget and update timeout value according to your project requirements. After 9 minutes a warning message "You have been inactive for 9 minutes. You will be automatically logged out after 1 minute" will be displayed. If the user still does not take any action within 1 minute then their session will be terminated. \r\n\r\n  - Use the 'SessionTerminatedPopup' to change session termination time. (if required) \r\nNOTE\: By default the microflow timer is set to 60 seconds, if you want to increase this time, then go to page 'SessionTerminatedPopup' which can be found under private folder. Edit microflow timer widget and update interval time according to your project requirements.\r\n\r\n**NOTE\: Make sure Idle timer time is always greater than microflow timer interval time **\r\n\r\n\r\n
